import styled from 'styled-components';
import { ReactComponent as Wave } from '../../assets/wave.svg';

export const Waves = styled(Wave)`
	display: block;
	width: 100%;
	/* height: 100px; */
	.rect {
		fill: ${(props) => props.theme.wave3};
		width: 100%;
		height: 100%;
		color: white;
	}
	.wave1 {
		fill: ${(props) => props.theme.contrastLight};
	}
	.wave2 {
		fill: ${(props) => props.theme.wave2};
	}
	.wave3 {
		fill: ${(props) => props.theme.wave3};
	}
`;

export const FooterContainer = styled.div`
	display: flex;
	background: black;
	color: white;
	justify-content: center;
	padding-top: 100px;
`;
